__NUXT_JSONP__("/boten/marshal", (function(a,b){return {data:[{story:{name:"Marshal",created_at:"2021-04-09T10:15:49.181Z",published_at:"2021-04-09T10:49:58.275Z",alternates:[],id:44964768,uuid:"aaa7dc07-0cf5-4445-90d2-6c9710355c2b",content:{_uid:"9b3cdf9e-878c-43b6-a94a-0b2a04838103",titel:"Marshall",images:[{id:2131124,alt:b,name:b,focus:a,title:b,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002Fdc0f3f26e5\u002F12a.png",copyright:b},{id:2131121,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x300\u002F586e764768\u002F12b.png",copyright:a},{id:2131122,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002F16f6f4cd39\u002F12d.jpg",copyright:a},{id:2131123,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F512x357\u002F5e186fe150\u002F12e.jpg",copyright:a}],component:"boten",thumbnail:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002F9ba6c621ab\u002F12a.png",uitvoering:"**Uitvoeringen:**\n\n* 700",beschrijving:"**Een oersterke allround boot**  \nEen degelijke alleskunner, een boot zonder onderhoud maar wel met veel ruimte. Met deze eigenschappen als uitganspunt, ontwikkelde Davy & Ørsted deze stoere open console boot, de “Marshal 700”.\n\n**100% aluminium, 100% onderhoudsvrij**  \nDe D&Ø Marshal is gemaakt van zeewaterbestendig aluminium met een legering van 4,5 ALMG en een dikte van 5 mm. Deze combinatie levert het ideale materiaal voor een onderhoudsvrije boot.\n\n**Zelflozend**  \nDe D&Ø Marshal is volledig zelflozend. Dit betekent dat de boot niet afgedekt hoeft te worden. Het opbergen van de kussens in de afsluitbare opbergruimtes onder de banken en het zonnedek is voldoende.\n\n**Ruimte**  \nMet een lengte van 7,00 m en een breedte van 2,60 m biedt de D&Ø Marshal een zee van ruimte.\n\n**Custom made**  \nDe D&Ø Marshal is een custom made sportboot, geheel naar wens van de koper hebben wij deze oersterke alleskunner gebouwd. Samen met de klant en het designteam van Davy & Ørsted zijn wij in staat de meest bijzondere boten te bouwen, wij houden we van een uitdaging!",specificaties:"volgt nog",calltoaction_text:"Wilt niet varend maar vliegend over het water met Nederlands nr 1. Aluminium sloep?\nVraag hier uw proefvaart aan",korte_beschrijving:"Een oersterke allround boot  \nEen degelijke alleskunner, een boot zonder onderhoud maar wel met veel ruimte. Met deze eigenschappen als uitganspunt, ontwikkelde Davy & Ørsted deze stoere open console boot, de “Marshal 700”."},slug:"marshal",full_slug:"boten\u002Fmarshal",default_full_slug:a,sort_by_date:a,position:-20,tag_list:[],is_startpage:false,parent_id:43882559,meta_data:a,group_id:"9284ace6-8fae-481d-93db-6e32e483e6e7",first_published_at:"2021-04-09T10:18:28.000Z",release_id:a,lang:"default",path:a,translated_slugs:[]}}],fetch:{},mutations:[]}}(null,"")));